from random import randint


def reverse(pattern):
    pattern_reversed = pattern[::-1]
    result = ''
    pairs = {'A': 'T', 'C': 'G'}
    for c in pattern_reversed:
        if c in pairs.keys():
            cc = pairs[c]
        else:
            for k, v in pairs.iteritems():
                if c == v:
                    cc = k
        result += cc

    return result


