from operator import mul


def calc_prob(kmer, profile):
    curr = []
    for i in xrange(len(kmer)):
        if kmer[i] == 'A':
            curr.append(profile[0][i])
        elif kmer[i] == 'C':
            curr.append(profile[1][i])
        elif kmer[i] == 'G':
            curr.append(profile[2][i])
        elif kmer[i] == 'T':
            curr.append(profile[3][i])
    return reduce(mul, curr, 1)


profile_helper_dic = {'A': 0, 'C': 1, 'G': 2, 'T': 3}


def ProfileMost(text, k, profile):
    max_prob = -1
    result = ''
    for i in xrange(len(text) - k + 1):
        curr_prob = 1
        for j, nuc in enumerate(text[i:i + k]):
            curr_prob *= profile[profile_helper_dic[nuc]][j]

        if curr_prob > max_prob:
            max_prob = curr_prob
            result = text[i:i + k]

    return result


def form_profile(motifs, k):
    ret_temp = [[0 for i in xrange(k)] for j in xrange(4)]
    for motif in motifs:
        for i in xrange(0, k):
            ret_temp[profile_helper_dic[motif[i]]][i] += 1

    total = sum(sum(x) for x in ret_temp)
    ret = [[float(ret_temp[j][i] + 1) / float(total) for i in xrange(k)] for j in xrange(4)]

    return ret


def cal_score(motifs, k):
    cols_matrix = [''.join(col) for col in zip(*motifs)]
    ret_sum = 0
    for col in cols_matrix:
        curr_max_score = 0
        for d in DNAs:
            curr_max_score = max(col.count(d), curr_max_score)
        ret_sum += len(col) - curr_max_score
    return ret_sum


