def random_selection(k, Dnas):
    motifs = []
    for dna in Dnas:
        ran_int = randint(0, len(dna) - k)
        motif = dna[ran_int:ran_int + k]
        motifs.append(motif)
    return motifs


def form_motifs(profile, dnas, k):
    return [ProfileMost(dna, k, profile) for dna in dnas]


