def bruijn(patterns):
    brujin_graph = {}
    for kmer in patterns:
        if kmer[:-1] in brujin_graph:
            brujin_graph[kmer[:-1]].append(kmer[1:])
        else:
            brujin_graph[kmer[:-1]] = [kmer[1:]]
    result = []
    for k, v in brujin_graph.items():
        result.append(' -> '.join([k, ','.join(v)]))
    with open('result.txt', 'w') as outfile:
        outfile.write('\n'.join(result))


