def form_cycle(cycle, graph, start):
    while True:
        next_neighbor = graph[start][0]
        cycle.append(next_neighbor)

        if len(graph[start]) == 1:
            graph.pop(start, None)
        else:
            graph[start].pop(0)

        if next_neighbor in graph:
            start = next_neighbor
        else:
            break


def findEulerianCycle(graph):
    cycle = []
    start = graph.keys()[0]
    cycle.append(start)

    form_cycle(cycle, graph, start)

    while graph:
        for i, curr in enumerate(cycle):
            if cycle[i] in graph:
                start = cycle[i]
                new_cycle = [start]

                form_cycle(new_cycle, graph, start)
                cycle = cycle[:i] + new_cycle + cycle[i + 1:]
                break
    return cycle


