def calc_out_degree(graph):
    ret = {}
    for k, v in graph.items():
        ret[k] = len(v)
    return ret


def calc_in_degree(graph):
    ret = {}
    for k, v in graph.items():
        for node in v:
            if node in ret.keys():
                ret[node] += 1
            else:
                ret[node] = 1
    return ret


def findEulerianPath(graph):
    circuit = []
    outdegree = calc_out_degree(graph)
    indegree = calc_in_degree(graph)

    all_nodes = set(graph.keys() + outdegree.keys() + indegree.keys())
    unbalanced_node = 0
    for node in all_nodes:
        out_degree = outdegree.get(node, 0)
        in_degree = indegree.get(node, 0)

        if out_degree > in_degree:
            unbalanced_node = node

    stack = []
    curr = unbalanced_node
    while True:
        if outdegree.get(curr, 0) == 0:
            if stack:
                circuit.append(curr)
                curr = stack.pop()
            else:
                break
        else:
            outdegree[curr] -= 1
            stack.append(curr)
            temp = graph[curr][0]
            graph[curr].pop(0)
            curr = temp

    circuit.append(unbalanced_node)
    circuit = circuit[::-1]

    return circuit


