def recontrusct(text_dict):
    prefix = text_dict.keys()
    suffix = text_dict.values()
    for pre in prefix:
        if pre not in suffix:
            head = pre
    for suff in suffix:
        if suff not in prefix:
            tail = suff
    result = head

    while head != tail:
        head = text_dict[head]
        result += head[-1]
    with open('result.txt', 'w') as outfile:
        outfile.write(result)


