def generate_all_combo(k, result, curr):
    if len(curr) == k:
        result.append(curr)
        return
    for c in '01':
        generate_all_combo(k, result, curr + c)


def findKuniversal(k):
    graph = {}
    all_combo = []
    generate_all_combo(k, all_combo, '')
    for combo in all_combo:
        if combo[:-1] in graph:
            graph[combo[:-1]].append(combo[1:])
        else:
            graph[combo[:-1]] = [combo[1:]]
    cycle = findEulerianCycle(graph)
    with open('result.txt', 'w') as outfile:
        outfile.write(''.join(c[0] for c in cycle[:-1]))


