def reconstructFromPair(k, d, pairs):
    graph = {}
    for p in pairs:
        p_tuple_prefix = (p[0][:-1], p[1][:-1])
        p_tuple_suffix = (p[0][1:], p[1][1:])
        if p_tuple_prefix in graph.keys():
            graph[p_tuple_prefix].append(p_tuple_suffix)
        else:
            graph[p_tuple_prefix] = [p_tuple_suffix]

    path = findEulerianPath(graph)
    path_list_pre = []
    for part in path[1:]:
        path_list_pre.append(part[0][-1])
    path_list_suff = []
    for part in path[1:]:
        path_list_suff.append(part[1][-1])
    result = (path[0][0] + ''.join(path_list_pre))[:k + d] + (path[0][1] + ''.join(path_list_suff))
    with open('result.txt', 'w') as outfile:
        outfile.write(result)


