def generate_contig(patterns):
    graph = {}
    path = []
    for pattern in patterns:
        prefix = pattern[:-1]
        suffix = pattern[1:]
        if prefix not in graph.keys():
            graph[prefix] = [suffix]
        else:
            graph[prefix].append(suffix)

    outdegrees = calc_out_degree(graph)
    indegrees = calc_in_degree(graph)

    all_nodes = set(graph.keys() + outdegrees.keys() + indegrees.keys())
    unbalanced_nodes = []
    for node in all_nodes:
        out_degree = outdegrees.get(node, 0)
        in_degree = indegrees.get(node, 0)

        if out_degree > 0 and not (out_degree == in_degree == 1):
            unbalanced_nodes.append(node)

    for node in unbalanced_nodes:
        contigs = []
        for neighbor in graph[node]:
            curr_path = [node]
            curr_path.append(neighbor)
            out_dg = outdegrees[neighbor] if neighbor in outdegrees.keys() else 0
            in_dg = indegrees[neighbor] if neighbor in indegrees.keys() else 0
            while out_dg == in_dg == 1:
                node = neighbor
                neighbor = graph[node][0]
                curr_path.append(neighbor)
                out_dg = outdegrees[neighbor] if neighbor in outdegrees.keys() else 0
                in_dg = indegrees[neighbor] if neighbor in indegrees.keys() else 0
            contigs.append(curr_path)
        path.extend(contigs)

    result = []
    for p in path:
        curr_result = p[0]
        for kmer in p[1:]:
            curr_result += kmer[-1]
        result.append(curr_result)
    return result


