def constructByGappedPath(k, d, pairs):
    result = ''
    prefix_arr = zip(*pairs)[0]
    suffix_arr = zip(*pairs)[1]

    prefix_part = prefix_arr[0]
    for prefix in prefix_arr[1:]:
        prefix_part += prefix[-1]
    suffix_part = suffix_arr[0]
    for suffix in suffix_arr[1:]:
        suffix_part += suffix[-1]

    result = prefix_part + suffix_part[-k - d:]

    return result


