def check_visited(node, paths):
    for p in paths:
        if node in p:
            return True
    return False


def MaximalNonBranchingPaths(graph):
    paths = []
    outdegrees = calc_out_degree(graph)
    indegrees = calc_in_degree(graph)

    all_nodes = set(graph.keys() + outdegrees.keys() + indegrees.keys())
    for node in all_nodes:
        out_degree = outdegrees.get(node, 0)
        in_degree = indegrees.get(node, 0)

        if out_degree > 0 and not (out_degree == in_degree == 1):
            for neighbor in graph[node]:
                curr_path = [node, neighbor]
                out_dg = outdegrees[neighbor] if neighbor in outdegrees.keys() else 0
                in_dg = indegrees[neighbor] if neighbor in indegrees.keys() else 0
                while out_dg == in_dg == 1:
                    curr_path.append(graph[curr_path[-1]][0])
                    out_dg = outdegrees[curr_path[-1]] if curr_path[-1] in outdegrees.keys() else 0
                    in_dg = indegrees[curr_path[-1]] if curr_path[-1] in indegrees.keys() else 0
                paths.append(curr_path)

    for node in list(all_nodes)[::-1]:
        out_degree = outdegrees.get(node, 0)
        in_degree = indegrees.get(node, 0)
        if out_degree == in_degree == 1:
            if not check_visited(node, paths):
                cycle = [node]
                out_dg = outdegrees[cycle[-1]] if cycle[-1] in outdegrees.keys() else 0
                in_dg = indegrees[cycle[-1]] if cycle[-1] in indegrees.keys() else 0
                while out_dg == in_dg == 1:
                    cycle.append(graph[cycle[-1]][0])
                    out_dg = outdegrees[cycle[-1]] if cycle[-1] in outdegrees.keys() else 0
                    in_dg = indegrees[cycle[-1]] if cycle[-1] in indegrees.keys() else 0
                    if cycle[-1] == cycle[0]:
                        paths.append(cycle)
                        break

    return paths


