def minChange(total, coins):
    dp = [9999999999999] * (total + 1)
    dp[0] = 0
    for i in xrange(1, total + 1):
        for c in coins:
            if c <= i:
                if dp[i - c] + 1 < dp[i]:
                    dp[i] = dp[i - c] + 1
    return str(dp[total])


