def manhattan(n, m, matrix1, matrix2):
    dp = [[0 for x in range(m+1)] for x in range(n+1)]
    for i in xrange(1, n + 1):
        dp[i][0] = dp[i - 1][0] + int(matrix1[i - 1][0])
    for j in xrange(1, m + 1):
        dp[0][j] = dp[0][j - 1] + int(matrix2[0][j - 1])
    for i in xrange(1, n + 1):
        for j in xrange(1, m + 1):
            dp[i][j] = max(dp[i - 1][j] + int(matrix1[i - 1][j]), dp[i][j - 1] + int(matrix2[i][j - 1]))

    return dp[n][m]

