def lcs(stra, strb):
    m = len(stra)
    n = len(strb)
    dp = [[0 for x in xrange(n+1)] for y in xrange(m+1)]

    for i in xrange(0, m+1):
        for j in xrange(0, n+1):
            if i == 0 or j == 0:
                dp[i][j] = 0
            elif stra[i-1] == strb[j-1]:
                dp[i][j] = dp[i-1][j-1] + 1
            else:
                dp[i][j] = max(dp[i-1][j], dp[i][j-1])

    result = ''
    while m is not 0 and n is not 0:
        if dp[m][n] == dp[m-1][n]:
            m -= 1
        elif dp[m][n] == dp[m][n-1]:
            n -= 1
        else:
            result = stra[m-1] + result
            m -= 1
            n -= 1
    return result



